import React from 'react';

export default MoreDetailsContent = ({city, numberOfPeople, tripLengt, seasonTimep, price, description}) => {
    return (
        <div> 
            <div>CITY: {city}</div>
            <div>FOR: {numberOfPeople}</div>
            <div>DURING: {tripLengt}</div>
            <div>IN: {seasonTime}</div>
            <div>FOR: {price}</div>
            <div>{description}</div>
        </div>

    );
}
